/* eslint-disable react/no-unescaped-entities */
import React from 'react';
import Octicon, { MarkGithub } from '@githubprimer/octicons-react';
import { TopBar, Paper } from '@../../../../reactify/build';
import {
  simpleCode,
} from './code-refrence';
import './top-bar.scss';
import DemoCard from '../../components/demo-card';

const TopBarDemo = () => (
  <div>
    <DemoCard
      title="Simple Use"
      uniqueIdentifier="simpleUse"
      sourceCode={simpleCode}
    >
      <TopBar large>
        <TopBar.Logo>
          <Paper success style={{ color: 'white', padding: '0.2em 0.4em', boxShadow: 'none' }} className="logo">reactify ui</Paper>
        </TopBar.Logo>
        <TopBar.Body>

        </TopBar.Body>
        <TopBar.Menu
          style={{
            display: 'inline-flex', alignContent: 'center', alignItems: 'center', padding: '0em 0.5em',
          }}
          warning
        >
          <a style={{ margin: 0, padding: 0, fontSize: 'unset !important' }} href="https://github.com/asterisx/reactify">
            <Octicon icon={MarkGithub} size="medium" ariaLabel="GitHub" />
          </a>
        </TopBar.Menu>
      </TopBar>
    </DemoCard>

  </div>
);

export default TopBarDemo;
